10.body:
For our example use case, the easiest way to allow the client to trust our server is to disable certificate verification (don't do this in production!). When the rustls dangerous_configuration feature flag is enabled, a client can be configured to trust any server. Start by adding a rustls dependency with the dangerous_configuration feature flag to your Cargo.toml file. quinn = "*"
rustls = { version = "*", features = ["dangerous_configuration", "quic"] } Then, allow the client to skip the certificate validation by implementing ServerCertVerifier and letting it assert verification for any server. // Implementation of `ServerCertVerifier` that verifies everything as trustworthy.
struct SkipCertificationVerification; impl rustls::ServerCertVerifier for SkipCertificationVerification { fn verify_server_cert( &self, _: &rustls::RootCertStore, _: &[rustls::Certificate], _: webpki::DNSNameRef, _: &[u8], ) -> Result<rustls::ServerCertVerified, rustls::TLSError> { Ok(ServerCertVerified::assertion()) }
} After that, modify the ClientConfig to use this ServerCertVerifier implementation. pub fn insecure() -> ClientConfig { let mut cfg = quinn::ClientConfigBuilder::default().build(); // Get a mutable reference to the 'crypto' config in the 'client config'. let tls_cfg: &mut rustls::ClientConfig = std::sync::Arc::get_mut(&mut cfg.crypto).unwrap(); // Change the certification verifier. // This is only available when compiled with the 'dangerous_configuration' feature. tls_cfg .dangerous() .set_certificate_verifier(Arc::new(SkipCertificationVerification)); cfg
} Finally, if you plug this ClientConfig into the EndpointBuilder::default_client_config() your client endpoint should verify all connections as trustworthy.

14.body:
Now that you have a valid certificate, the client and server need to be configured to use it. After configuring plug the configuration into the Endpoint. Configure Server let mut builder = ServerConfigBuilder::default();
builder.certificate(CertificateChain::from_certs(vec![certificate]), key)?; This is the only thing you need to do for your server to be secured. Configure Client let mut builder = ClientConfigBuilder::default();
builder.add_certificate_authority(certificate)?; This is the only thing you need to do for your client to trust a server certificate. Next , let's have a look at how to set up a connection.

16.body:
Let's start by defining some constants. static SERVER_NAME: &str = "localhost"; fn client_addr() -> SocketAddr { "127.0.0.1:5000".parse::<SocketAddr>().unwrap()
} fn server_addr() -> SocketAddr { "127.0.0.1:5001".parse::<SocketAddr>().unwrap()
} The EndpointBuilder should be used to configure an endpoint. It is also possible to provide Quinn with an initialized socket via with_socket() . Server First, the server endpoint should be bound to a socket. The bind() method, which can be used for this, returns a tuple containing the Endpoint and Incoming types. The Endpoint type can be used to start outgoing connections, and the Incoming type can be used to listen for incoming connections. async fn server() -> anyhow::Result<()> { let mut endpoint_builder = Endpoint::builder(); // Configure this endpoint as a server by passing in `ServerConfig`. endpoint_builder.listen(ServerConfig::default()); // Bind this endpoint to a UDP socket on the given server address. let (endpoint, mut incoming) = endpoint_builder.bind(&server_addr())?; // Start iterating over incoming connections. while let Some(conn) = incoming.next().await { let mut connection: NewConnection = conn.await?; // Save connection somewhere, start transferring, receiving data, see DataTransfer tutorial. } Ok(())
} Client The client needs to connect to the server using the connect(server_name) method. The SERVER_NAME argument is the DNS name, matching the certificate configured in the server. async fn client() -> anyhow::Result<()> { let mut endpoint_builder = Endpoint::builder(); // Bind this endpoint to a UDP socket on the given client address. let (endpoint, _) = endpoint_builder.bind(&client_addr())?; // Connect to the server passing in the server name which is supposed to be in the server certificate. let connection = endpoint.connect(&server_addr(), SERVER_NAME)?.await?; // Start transferring, receiving data, see data transfer page. Ok(())
} Next up , let's have a look at sending data over this connection.

