With bidirectional streams, data can be sent in both directions. For example, from the connection initiator to the peer and the other way around. open bidirectional stream async fn open_bidirectional_stream(connection: Connection) -> anyhow::Result<()> { let (mut send, recv) = connection. open_bi() .await?; send.write_all(b"test").await?; send.finish().await?; let received = recv.read_to_end(10).await?; Ok(())
} iterate incoming bidirectional stream(s) async fn receive_bidirectional_stream(mut connection: NewConnection) -> anyhow::Result<()> { while let Some(Ok((send, recv))) = connection.bi_streams.next().await { // Because it is a bidirectional stream, we can both send and recieve. println!("request: {:?}", recv.read_to_end(50).await?); send.write_all(b"response").await?; send.finish().await?; } Ok(())
}

22.body:
With unidirectional streams, you can carry data only in one direction: from the initiator of the stream to its peer. It is possible to get reliability without ordering (so no head-of-line blocking) by opening a new stream for each packet. open unidirectional stream async fn open_unidirectional_stream(connection: Connection)-> anyhow::Result<()> { let mut send = connection. open_uni() .await?; send.write_all(b"test").await.unwrap(); send.finish().await?; Ok(())
} iterating incoming unidirectional stream(s) async fn receive_unidirectional_stream(mut connection: NewConnection) -> anyhow::Result<()> { while let Some(Ok(recv)) = connection.uni_streams.next().await { // Because it is a unidirectional stream, we can only receive not send back. println!("{:?}", recv.read_to_end(50).await?); } Ok(())
}

