With unreliable messaging, you can transfer data without reliability. This could be useful if data arrival isn't essential or when high throughput is important. send datagram async fn send_unreliable(connection: Connection)-> anyhow::Result<()> { connection .send_datagram(b"test".into()) .await?; Ok(())
} iterating datagram stream(s) async fn receive_datagram(mut connection: NewConnection) -> anyhow::Result<()> { while let Some(Ok(received_bytes)) = connection.datagrams.next().await { // Because it is a unidirectional stream, we can only receive not send back. println!("request: {:?}", received); } Ok(())
}
